description:
La base permanente des équipements (BPE), produite par l'INSEE, est destinée à fournir le niveau d'équipement et de services rendus par un territoire à la population.


Ce jeu de données dénombre les  fonctions médicales et paramédicales au niveau communal (arrondissement de Paris et commune).

 **Liste des variables :**

  * Médecin omnipraticien ;
  * Spécialiste en cardiologie ;
  * Spécialiste en dermatologie vénéréologie ;
  * Spécialiste en gynécologie médicale ;
  * Spécialiste en gynécologie obstétrique ;
  * Spécialiste en gastro-entérologie hépatologie ;
  * Spécialiste en psychiatrie ;
  * Spécialiste en ophtalmologie ;
  * Spécialiste en oto-rhino-laryngologie ;
  * Spécialiste en pédiatrie ;
  * Spécialiste en pneumologie ;
  * Spécialiste en radiodiagnostic et imagerie médicale ;
  * Spécialiste en stomatologie ;
  * Chirurgien dentiste ;
  * Sage-femme ;
  * Infirmier ;
  * Masseur kinésithérapeute ;
  * Orthophoniste ;
  * Orthoptiste ;
  * Pédicure-podologue ;
  * Audio prothésiste ;
  * Ergothérapeute ;
  * Psychomotricien.
